				"description" : "<p>May be one word, or a little thing can remind you of somebody. We&rsquo;ll be very happy that this daisy ring can make you think of the most one in your deep memory,so that our designers' original intention can make it. Now, whenever and wherever you are, we hope that it can accompany you forever.<\/p>\n<p>Although the elements of flowers is very common, but it&rsquo;s very difficult to think about how to make it unique and fashion. Although it seems exaggerated that one 9 * 9mm, 2.75ct yellow cubic zirconia is surrounded by four daisies, but the exquisite design ratio and match of color will make you feel surprised.<\/p>\n<p>If you are a person who is not good at expressing your pure love for her, please choose this ring, it can help you to convey your message; if you want someone to stay forever in your heart, please choose this ring, it allows you to think of him/her everytime you see it; if you have a friend with ragweed allergies who loves daisy very much,please choose this ring, we can guarantee the 925 sterling silver we used,so that she can't be allergic again.<\/p>\n<p>YANG , the jewelry designer .On the journey of design, she created many jewelry for hundreds of people, all of the designs are the favorite pieces of her customer. Yang also created some customization pieces which are competing imitation by many famous jewelry brand. Her designs published on the leading jewelry magazine when she was a student in Design Dept. Most of the designs is collected by fashion people, and some jewelry collectors.<br /><br /><strong>Q: &nbsp;Tell us about yourself, including what you do, and how to get the current status of work?<\/strong><br /><br />YANG: I was an art student background, since childhood I was more sensitive on the good things, so I like to create beauty. Jewelry design really started when I was a college student, in the spare time I also tried to do a part-time jewelry design and drawing work. When I see my first piece worn on my customer, and she was very satisfied with that design ,I thought it must be the time to be a jewelry designer. I love this job so deeply much.&nbsp;At the beginning of my job, I am a advanced custom jewelry designer, to create the customized jewelry for every customer. This job helps me a lot, my customer shared many stories to me, according to those stories, I can feel the inner perception and different individuals of the uniqueness of each person's pursuit. This is exactly what I sought---to make the jewelry with story.<br /><br /><img src=\"/media/m_d_p_image/xydsp01-m_d_p_image03.jpg\" alt=\"\" /><br /><br /><strong>Q: &nbsp;Please tell us about your style, what kind of person suitable for wearing your jewelry designs?<\/strong>&nbsp;<br /><br />YANG: My design style can be summed up by one word - Elegance. Everyone pursues unique, I was no exception, I personally prefer relatively elegant, simple, stylish style, and I like to try different elements, such as three-dimensional structure, geometry, totem symbols, etc. I think through the design language , these cold, masculine elements can be transformed into decorative jewelry for elegant women. If I have to give my audience a circle divided into words, Personally, I may feel more suitable for those economic independence, fashion, and the pursuit of texture women.&nbsp;<br /><br /><strong>Q: As a designer, where you draw your inspiration?<\/strong><br /><br />YANG: I am sensitive for all of the images , so I like to watch videos, see the exhibition, read the works of visual communication. I like things during European Art Nouveau and Art Deco movement. Their natural shape extraction and generalization is superb, curved lines, arc, interspersed, every detail impressed me deeply. Art Deco period is a great impact on contemporary minimalism, their design is more suitable for the modern aesthetic orientation, the geometry of the elements they use is very sexy.<br /><br /><img src=\"/media/m_d_p_image/xydsp01-m_d_p_image01.jpg\" alt=\"\" /><br /><br /><strong>Q: Who is your favorite designer?<\/strong><br /><br />YANG: I like a lot of designers, I think everyone has a good on the one hand, it can be used as my teacher. My favorite jewelry designer is actually an artist - Salvador Dali, he designed a number of cross-border surrealistic piece of jewelry is very interesting. Look at his design I can feel his artistry is very high, very sensitive, very rich imagination. And he did not neglect the feeling of wearing, but many jewelry designer ignored this point. In addition British designer Stephen Webster is also a brilliant jewelry designer I admired, he is good at to design the mysterious dark elements very elegant and sexy.&nbsp;<br /><br /><strong>Q: What is in the upcoming trend for jewelry design industry?<\/strong><br /><br />YANG: In my opinion. At the moment of the uniqueness of each individual's pursuit of more and more significant, so advanced custom jewelry will be gradually integrated into daily wear. This kind of jewelry is very obvious from the property, cause everyone wants to highlight their individuality .So every designer should consider how to do a direct access to the customer's heart.&nbsp;<\/p>",
